import styled from "styled-components";

const AccountStyle = {
    ContainerAccount: styled.div`
    padding-left: 120px;
    `,
    SideBar: styled.nav`
    width: 100px;
    display: flex;
    position: absolute;
    flex-direction: column;
    align-items: center;
    left: 0;
    top: 0;
    background-color: blue;
    padding: 20px;
    height: 100vh;
    `,
    ContainerAbout: styled.div`
    display: flex;
    `,
    ContainerImg: styled.div`
    max-width: 320px;
    max-height: 568x;
    margin-right: 50px;
    `,
    AboutMe: styled.div`
    font-size: 25px;
    max-width: 320px;
    `,
    ContainerListTags: styled.ul`
    display: flex;
    `,
    ItemTags: styled.li`
    padding: 3px, 5px;
    border: solid 1px blue;
    border-radius: 5px;
    `
}

export default AccountStyle
